import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Checkout from './Stripe/StripeButton'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 >STRIPE PAYMENT GATEWAY INTEGRATION</h1>
        <img src={require('./assets/tesla.jpg')} className="App-logo" alt="logo" />
        {/* <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          PURCHASE
        </a> */}
        <Checkout 
        name={'TESLA E-6636, Here you GO ..! '} 
        amount={99999999}
        description={'Electric driven with power to maintain your enthu'}
        />
      </header>
    </div>
  );
}

export default App;
